AGREEMENT
1.	TERM; EARLY TERMINATION
1.1	Term. The term of this Agreement shall commence on the Effective Date and shall continue in effect until terminated (a) by mutual agreement of the Parties, or (b) pursuant to Section 1.2 of this Agreement.
1.2	Early Termination. This Agreement shall automatically terminate, without further action by any Party and without further liability of any Party to any other Party (except for obligations accruing prior to the termination), upon the termination of the San Juan Solar GIA.
2.	ACKNOWLEDGEMENT OF INTERCONNECTION, REAL PROPERTY AND SHARED FACILITIES RIGHTS
2.1	Acknowledgement of Interconnection Rights. The Project Companies acknowledge that the rights to, access and use of the Shared Facilities is necessary to interconnect their respective Projects to the Transmission System as part of the Large Generating Facility defined in the San Juan Solar GIA and that ownership, operation and maintenance of its respective Projects can only be facilitated via the Shared Facilities. The acknowledgement under this Agreement is made only to the extent that (a) such rights do not limit in any material respect the ability of any Party, as the Interconnection Customer, to comply with the terms and conditions of the San Juan Solar GIA and (b) such rights of each Project Company shall not, in any event, exceed their respective Capacity Allocation in respect of the Shared Facilities use right. Except with respect to San Juan Storage whose Use Right Date occurred on May 26, 2023, and pursuant to Section 4.1(i)(y), the Other Project Companies shall have no right to use the Shared Facilities, nor any responsibility

or obligation for any costs or liabilities with respect thereto, except as provided for in Section 4.1(i) hereto with respect to the Phase 2 TPIF Costs, until such Other Project Company delivers written notice to the other Project Companies and the Shared Facilities Manager that such Other Project Company intends to commence using the Shared Facilities (???Use Exercise Notice???) and take interests in the Shared Facilities (???Use Interests???), which Use Exercise Notice shall set forth the date such use right is to commence (the ???Use Right Date???). As of its respective Use Right Date, each Use Right Project Company shall (i) become an Applicable Project Company and (ii) have the right to use the Shared Facilities on the terms and subject to the conditions hereof. Further, nothing in this Agreement alters any rights and obligations under Section 5.1(A) of the ESA.
2.2	Real Property. San Juan Solar will execute and deliver to the applicable Other Project Company the Partial Assignment for Separate Easement set out as Exhibit B attached hereto to grant such Other Project Company the rights to enter upon Shared Easement Property to access the Shared Facilities. Each Party shall own and hold an undivided interest in the Shared Easement Property jointly, as tenants-in- common, and without rights of survivorship, subject to the terms of this Agreement, to the full extent necessary for its Project to operate. Without limiting the generality of the foregoing, the undivided joint rights of each Party shall include: the joint use of the Shared Easement Property to the full extent necessary for each Project to operate, subject to the terms of this Agreement. Each Party shall have the right to own, hold, and utilize its undivided interest in the Shared Easement Property in accordance with the terms of this Agreement.
3.	NATURE OF SHARED FACILITIES RIGHTS
3.1	Nature of Services. The Parties acknowledgement of rights under this Agreement to access and use the Shared Facilities is required by the San Juan Solar GIA, the PPA and the ESA and is made for the purpose of enabling the energy from each Project Company???s Project to reach the transmission system of PNM, and for energy from the transmission system of PNM, if any, to reach the Energy Storage Projects. Subject to the Consents (as defined below in Section 3.2), the rights under this Agreement are not intended to, and shall not, for the avoidance of doubt, (i) adversely affect the operations of the San Juan Solar Project or the San Juan Storage Project in any respect or (ii) subject to clause (i), limit the ability of any Party to perform its obligations under any agreement, as the same may hereafter be modified or amended, that such Party has entered into or enters into after the date hereof.
3.2	Use of Shared Facilities. Subject to the terms and provisions of this Agreement, and the San Juan Solar GIA, once installation of the applicable Shared Facilities required for a Project Company to interconnect are completed, each Applicable Project Company shall have the right to use the Shared Facilities based on such Project Company???s Proportionate Share, as applicable; provided, however, that notwithstanding anything to the contrary, the allocation of interconnection capacity among the Applicable Project Companies is governed by the proviso in the definition of ???Capacity Allocation??? and the interconnection capacity allocated to

an Applicable Project Company may be up to the aggregate Proportionate Shares of such Applicable Project Companies subject to the proviso in the definition of ???Capacity Allocation???. Subject to Section 3.3(viii), the Project Companies consent to such temporary interruptions, reductions or curtailments of use and operation of the Shared Facilities or their Projects as may be required to complete the installation and testing of such other additional or modified interconnection facilities, and such incremental Shared Facilities management and maintenance activities or requirements that will naturally result from having the Other Project Company???s projects installed in the Shared Easement Property (???Consents???).
3.3	Obligations of Project Companies. Each Project Company shall exercise its rights and perform its obligations under this Agreement in a manner consistent with its obligations under the San Juan Solar GIA and its Offtake Agreement. Without limiting the generality of the foregoing, during the term of this Agreement, each Project Company agrees to:
(i)	operate its Project and perform its obligations under this Agreement and its Offtake Agreement in accordance with Good Utility Practice, Applicable Laws and Regulations and Applicable Reliability Standards, in each case as defined in the San Juan Solar GIA, and in a manner consistent with the terms of the San Juan Solar GIA and its Offtake Agreement;
(ii)	facilitate each other Project Company???s compliance with all provisions of the San Juan Solar GIA and any Offtake Agreement to which such other Project Company is a party (including, without limitation, all insurance requirements, operational limits which includes an overall point of interconnection limit of 400 MWac at any given time, operating guides, operating procedures and reliability standards and requirements applicable by virtue thereof);
(iii)	not take any action (or refrain from taking any action) which would result in a breach of the San Juan Solar GIA or any Offtake Agreement;
(iv)	use all commercially reasonable efforts to promptly resolve any technical issues arising in connection with the operation of its Project that might reasonably be expected to result in a default under the San Juan Solar GIA or any Offtake Agreement, and if such default occurs or is determined by the Shared Facilities Manager in good faith to be reasonably likely to occur, promptly cure and assist the Shared Facilities Manager in curing such default in accordance with the terms of the San Juan Solar GIA and any Offtake Agreement;
(v)	comply with all instructions, as may be communicated to it by the Shared Facilities Manager, in order to ensure compliance with the provisions of the San Juan Solar GIA and its Offtake Agreement;
(vi)	provide the Shared Facilities Manager with all reasonable information regarding the operation and condition of its Project required for each

other Project Company to maintain compliance with the terms and conditions of the San Juan Solar GIA and their respective Offtake Agreement;
(vii)	promptly provide the Shared Facilities Manager copies of all notices and instructions received by such Project Company that affect performance under the San Juan Solar GIA or such Project Company???s Offtake Agreement;
(viii)	provide payment to the Shared Facilities Manager within ten (10) business days following receipt of demand therefor by any Project Company for (a) any lost revenues any time such Project Company???s Project is curtailed, disconnected, or experiences an outage due to actions or inactions by such other Project Company due to interconnection activities, operations and maintenance, or other reasons, with such lost revenues including all revenues that the Project Company would have earned for energy, green attributes, capacity, production tax credits, or other products it would have sold under the applicable agreements to which it is a party, (b) a Project Company???s availability incentive or bonus payments lost, or (c) other penalties, costs or charges incurred by such Project Company, as a direct result of any interruptions or curtailments of output from such Project; in each case, such payments made or to be made by such Project Company shall be reduced by any net insurance proceeds actually received by the Project Company in connection with the events described in subclauses (a), (b) or (c) of this Section 3.3(viii); and
(ix)	not exceed its Capacity Allocation.
3.4	No Joint and Several Liability between the Project Companies. The Parties acknowledge that this Agreement does not subject any Project Company to joint and several liability for any actions taken, or inaction, by any other Party. Nothing contained in this Agreement shall be construed to create an association, joint venture or partnership or impose a partnership duty, obligation or liability among the Project Companies. No Project Company shall have a right or power to bind any other Project Company without its express written consent, except as expressly otherwise provided in this Agreement.
3.5	Assignment or Transfer of Rights. Except as set forth in Section 12.5 hereof, each of the Project Companies shall not assign or transfer any rights granted to such Party hereunder with regard to the Shared Facilities, or grant any permission, license, right of way or similar right with regard to the Shared Facilities, without the prior written consent of the other Parties.
3.6	Interference. Subject to the terms of this Agreement, in no event shall any Party be entitled to exercise its rights to access and utilize the Shared Facilities if the exercise of such rights would materially interfere with or limit the reasonable and necessary access and utilization of the Shared Facilities by any other Party.
3.7	Prior Written Consent. Except as set forth in this Agreement, without the prior written consent of the other Parties, no Party shall take any action that results in (i)

the forbearance, foreclosure, termination or alteration of the respective rights of any other Party or (ii) increases of the obligations or responsibilities of any other Party, in each case, with respect to such Party???s access to, utilization of or reliance upon the Shared Facilities.
4.	MAINTENANCE OF SHARED FACILITIES; SUCCESSOR AGREEMENT; METERING
4.1	Allocation of Certain Costs and Expenses.
(i)	Prior to any Use Right Date for the Use Right Project Companies,
(x) San Juan Solar, in its capacity as a Project Company, shall be responsible for its Proportionate Share of (a) the costs and expenses of the operation, inspection, maintenance, repair, alteration, relocation, improvement and replacement of the Shared Facilities and of insuring the Shared Facilities, and (b) the costs under the San Juan Solar GIA, including potential costs under Section 10.5 of the San Juan Solar GIA for operations and maintenance expenses (collectively, the ???Shared Expenses???) and (y) San Juan Energy Storage shall be responsible for its Proportionate Share of the Shared Expenses. Notwithstanding the foregoing or anything to the contrary in this Agreement, the Phase 2 Project Companies shall be solely responsible for the Phase 2 TPIF Costs.
(ii)	After each Use Right Date for a Use Right Project Company, each Applicable Project Company shall be responsible for its updated Proportionate Share of the Shared Expenses with respect to the Shared Facilities.
(iii)	San Juan Solar (in its capacity as a Project Company) and each Other Project Company shall be liable to pay for the station power service of its Project. Each of San Juan Solar (in its capacity as a Project Company), and each Other Project Company hereby agrees to work together in good faith and to execute such agreements as are reasonably required, in each case in connection with finalization of the station power service arrangements for its Projects.
4.2	Invoicing for Shared Expenses. Shared Facilities Manager may send invoices to the Applicable Project Companies with respect to their Proportionate Share of the Shared Expenses for which they are responsible as described in Section 4.1 up to thirty (30) days in advance of each quarter for the budgeted amounts in the applicable Annual Operating Plan and Budget for such quarter (or if there is no quarterly budgeted amount, then for 1/4th of the annual budgeted amount) on a quarterly basis within ten (10) days after the end of each quarter. Each Applicable Project Company shall pay to Share Facilities Manager its Proportionate Share of the Shared Expenses invoiced within thirty (30) days after receipt thereof (provided that such payment shall not be deemed a waiver of such Applicable Project Company???s right to dispute such amount pursuant to the terms hereof). Any invoiced amounts not paid within thirty (30) days after receipt of Shared Facilities Manager???s invoice shall thereafter bear interest at the Interest Rate until paid in full (provided, that no interest shall be due and payable on any invoiced amount to the

extent such invoiced and disputed amount is later determined to not be due and payable). Any amount received by Shared Facilities Manager in respect of the Shared Expenses shall be reimbursed to San Juan Solar, as a Project Company to the extent San Juan Solar, as a Project Company, initially paid such amounts.
4.3	Metering/Line Losses. Each Project Company shall install a separate revenue quality meter for its respective Project (each, a ???Revenue Meter???) in accordance with the San Juan Solar GIA and the PNM tariff. The Revenue Meter readings shall be adjusted to account for transformer and transmission line losses occurring between each Project???s Revenue Meter and the Point of Interconnection in accordance with the PNM tariff.
4.4	Successor Agreement. In the event that the Shared Facilities are no longer operated and maintained only by San Juan Solar for any reason, the Parties agree to use good faith efforts to negotiate mutually agreeable terms and execute a mutually agreeable agreement (or amendment to this Agreement) that specifies the division of responsibilities of the entities providing operation and maintenance services associated with the Shared Facilities.
4.5	Further Assurances. Each Party hereto covenants and agrees to promptly work in good faith to do and perform such other and further acts and things as any other Party hereto may reasonably request or as may be otherwise be necessary or proper to effect the appropriate allocation of the following items among the Projects as contemplated under Section 6.3: (A) the energy output and usage of the applicable Projects, (B) associated losses, and (C) payments associated with the Projects??? energy output, usage, and losses.
5.	CHANGE IN LAW
5.1	Change in Law. In the event that a change in the laws or regulations applicable to the Shared Facilities, any of the Projects, or this Agreement requires the amendment, modification or replacement of this Agreement in order to satisfy any applicable federal, state or local regulatory requirements, the Parties agree to use good faith efforts to negotiate and implement mutually agreeable terms to accomplish such amendment, modification or replacement.
6.	CERTAIN COVENANTS
6.1	Authority and Operational Abilities. Each of the Parties represents, as of the Effective Date, and covenants for the term of this Agreement, that such Party has the legal authority and operational abilities to fulfill its obligations under this Agreement.
6.2	Agreement to Cooperate. Each Party agrees to reasonably cooperate with the other Parties so that, subject to the terms of this Agreement, each Project benefits from the full utilization and enjoyment of the Shared Facilities as is necessary for the efficient operation of each such Project.

6.3	Adverse Events.
(i)	If an operational issue arises at any Project that is reasonably expected to result in a material breach of the San Juan Solar GIA, any Offtake Agreement, or this Agreement or if required to comply with any applicable Tariff requirements of PNM (as defined in the San Juan Solar GIA, the PPA, or the ESA) (an ???Adverse Event???), the Project Company whose Project is causing the Adverse Event shall curtail its Project. In the event of such curtailment, energy deliveries to or withdrawals from the Point of Interconnection from the Project that has caused the Adverse Event shall be limited as necessary until the Adverse Event has been cured in the reasonable judgment of the Shared Facilities Manager.
(ii)	If, as a direct result of an Adverse Event caused by a Project, the Shared Facilities Manager incurs costs, expenses, or penalties of any kind (???AE Costs???), the Project Company owning the Project that caused such Adverse Event shall be solely responsible for such AE Costs. In the event that more than one Project is responsible for the Adverse Event, and to the extent that Shared Facilities Manager, in its sole and absolute discretion, can accurately allocate responsibility for such Adverse Event between such Projects, each Project Company shall be responsible for only its allocable portion of such applicable AE Costs in the amount determined by the Shared Facilities Manager. If, however, it is not reasonably possible for Shared Facilities Manager, as determined in its sole and absolute discretion, to (i) determine which of the Projects is responsible for the Adverse Event or (ii) accurately allocate such responsibility, then responsibility for the AE Costs shall be allocated among the Applicable Project Companies based on their respective Proportionate Share.
6.4	No Dedication of Property; No Public Access. Each Party agrees that entering into this Agreement, performing its obligations hereunder, or exercising its rights hereunder, either in whole or part, is not intended to be, and shall in no way be construed as or deemed to be a dedication to public or quasi-public use or purpose of any of the Project Specific Assets of the Party, the Project Specific Assets of another Party, any Shared Facilities or Shared Easement Property, or any portion of the foregoing. Each Applicable Project Company undertakes to cooperate in enforcing such requirement for limiting physical access to the Shared Facilities and Shared Easement Property, including permitting the Shared Facilities Manager to establish and enforce procedures and protocol for security, safety, and protection of the Shared Facilities and Shared Easement Property.
6.5	Partition Waiver. Each Project Company agrees that its undivided tenancy in common interests in the Shared Easement Property are not suitable for partition. Accordingly, each Project Company irrevocably waives any and all rights that it may have under applicable laws to maintain any action, suit or claim for partition of all or any part of their undivided interests in the Shared Easement Property.
7.	Appointment of Shared Facilities Manager; Duties of Shared Facilities Manager.

7.1	Engagement of Shared Facilities Manager. Each Project Company hereby engages San Juan Solar as an independent contractor of such Project Company to manage, operate and maintain the Shared Facilities and the Shared Easement Property, and to perform such other duties pertaining to the Shared Facilities and the Shared Easement Property as are provided for herein, and San Juan Solar accepts such engagement, and agrees to perform such duties, in accordance with the terms and conditions hereof.
7.2	Relationship. Except as otherwise set forth in this Agreement (a) neither the Shared Facilities Manager nor any of its affiliates, employees, subcontractors, vendors or suppliers, nor any of their respective employees (???Shared Facilities Manager Persons???), shall be deemed to be agents, representatives, employees, or servants of any other Project Company as a result of this Agreement or of performing any services hereunder, and (b) no such Shared Facilities Manager Person as a result of entering into this Agreement or of performing any services hereunder shall have the right, authority, obligation or duty to assume, create or incur any liability or obligation, express or implied, against, in the name of, or on behalf of any Project Company. In no case shall this Agreement be construed to create a relationship of partnership or any other association of profit between any Project Company, on the one hand, and the Shared Facilities Manager or any other Shared Facilities Manager Persons, on the other hand.
7.3	Resignation and Removal of Shared Facilities Manager. Shared Facilities Manager shall have the right to resign upon sixty (60) days??? notice to the Project Companies. If Shared Facilities Manager resigns or is removed for cause pursuant to Section 8, a successor Shared Facilities Manager shall be selected by mutual agreement of the Project Companies and may be a third party selected by the Project Companies. In the event of any removal or resignation of Shared Facilities Manager, Shared Facilities Manager shall provide reasonable assistance to the Project Companies to assure a smooth, efficient transition of its services to the Project Companies, or any successor Shared Facilities Manager selected by the Project Companies, for which the former Shared Facilities Manager shall be reimbursed its reasonable expenses in connection therewith.
7.4	Duties of Shared Facilities Manager. During the term of this Agreement, San Juan Solar agrees to serve as the Shared Facilities Manager to:
(i)	perform its obligations under this Agreement in accordance with Good Utility Practice, Applicable Laws and Regulations and Applicable Reliability Standards, in each case as defined in the San Juan Solar GIA, and in a manner consistent with the terms of the San Juan Solar GIA;
(ii)	comply with all provisions of the San Juan Solar GIA (including, without limitation, all insurance requirements, payments due, operational limits, operating guides, operating procedures and reliability standards and requirements applicable by virtue thereof);

(iii)	serve as a single point of contact for PNM under the San Juan Solar GIA, and to promptly provide to each Applicable Project Company any material notices it receives under the San Juan Solar GIA from PNM;
(iv)	prepare annual operating plans and budgets and budget amendments as required with respect to the Shared Facilities, and present such operating plans and budgets to Applicable Project Companies for review and approval;
(v)	maintain books and records related to the Shared Facilities and Shared Easement Property in accordance with generally accepted accounting principles and all requirements of FERC applicable to Shared Facilities Manager or with respect to Shared Facilities or Shared Easement Property, and make such books and records available to any Applicable Project Company upon the written request of such Applicable Project Company during Shared Facilities Manager???s regular business hours;
(vi)	perform (or cause to be performed) necessary maintenance on the Shared Facilities;
(vii)	provide each Applicable Project Company written notice of any communications, orders or requirements of any governmental authority received by Shared Facilities Manager affecting the Shared Facilities; and
(viii)	keep each Applicable Project Company reasonably apprised of significant matters concerning the operation, maintenance and repair of the Shared Facilities and the Shared Easement Property.
7.5	Annual Operating Budget. By no later than ninety (90) days prior to the contemplated construction completion date for the Shared Facilities, and on or before November 1 of each year thereafter, Shared Facilities Manager shall prepare and deliver or cause to be prepared and delivered to the Applicable Project Companies a draft operating plan and budget for the ensuing calendar year (or in the case of the initial annual operating plan and budget, for the first full calendar year thereafter), which will set forth, as applicable, anticipated operations plans and costs, including forecasts of repairs and capital improvements, scheduled outages, routine maintenance, spare part and equipment procurement and third party consulting services, together with a reasonably detailed budget for the costs to be incurred in connection therewith. Each Applicable Project Company shall either approve, or deliver their comments on, such draft annual operating plan and budget within twenty (20) business days after receipt. If an Applicable Project Company fails to deliver any comments or its approval within twenty (20) business days of receipt thereof, such Applicable Project Company shall be deemed to have approved such draft annual operating plan and budget. An annual operating plan and budget approved or deemed approved by Applicable Project Companies collectively holding a Majority Use Interest shall be referred herein as an ???Annual Operating Plan and Budget???.

8.	MATERIAL BREACH; LIMITATIONS
8.1	Material Breach by any Party. In the event of any material breach of this Agreement by any Party and such Party fails to promptly cure such breach within a reasonable time not to exceed thirty (30) days after receipt of written notice from any other, non-defaulting Party describing such breach, a non-defaulting Party shall have the right, but not the obligation, in addition to all remedies available to it at law or in equity, to (i) cure the breach on behalf of the defaulting Party, or (ii) if Shared Facilities Manager is a non-breaching Party, suspend the defaulting Party???s access to all or any portion of the Shared Facilities for so long as such default shall be continuing and remain uncured. Notwithstanding the foregoing, in the event that a breach of this Agreement could give rise to a breach of the terms of the San Juan Solar GIA, a non-defaulting Party shall not be required to provide the defaulting Party with notice and/or an opportunity to cure in order to exercise the remedies specified in clause (i) or (ii) above; provided, that the remedy specified in clause (i) may be exercised, without prejudice to any right or remedy of any Party hereunder, by any lender or investor of such Party or its direct or indirect owner or their respective agents (???Financing Party???). If a non-defaulting Party (or any Financing Party thereof) chooses to cure a defaulting Party???s default, the defaulting Party shall reimburse such non-defaulting Party (or such Party???s Financing Party) upon demand for all commercially reasonable costs incurred by such non-defaulting Party (or such Party???s Financing Party) in curing such default.
8.2	Except for indemnification obligations related to third-party claims as provided for in Section 12.6 or as otherwise expressly provided for in this Agreement, in no event shall any Party be liable under any provision of this Agreement for any special, indirect, incidental, consequential, or punitive damages including, but not limited to, loss of profit or revenue, loss of the use of equipment, cost of capital, cost of temporary equipment or services, whether based in whole or in part in contract, in tort, including negligence, strict liability, or any other theory of liability.
9.	FORCE MAJEURE
9.1	Force Majeure. Upon any occurrence beyond a Party???s reasonable control that prevents such Party from fulfilling an obligation under this Agreement and that would constitute an event of Force Majeure (as defined in the San Juan Solar GIA), such Party shall not be liable for the delay in performance of, or the failure to perform, its obligations (other than obligations for payment of amounts due hereunder) under this Agreement caused directly or indirectly thereby. The Party affected shall promptly give notice and the full particulars of such Force Majeure (as defined in the San Juan Solar GIA) to the other Party in writing or by telephone as soon as reasonably possible after the occurrence of the cause relied upon. Telephone notices given pursuant to this article shall be confirmed in writing as soon as reasonably possible and shall specifically state full particulars of such Force Majeure, the time and date when such Force Majeure occurred and when such Force Majeure is reasonably expected to cease. The Party affected shall exercise due diligence to remove such disability with reasonable dispatch, but shall not be

required to accede or agree to any provision not satisfactory to it in order to settle and terminate a strike or other labor disturbance.
10.	CONFIDENTIALITY
10.1	Restrictions on Disclosure. The Confidential Information shall not be disclosed or permitted to be disclosed by the Receiving Party to any other third party not a party hereto without the prior written consent of the Disclosing Party, except:
